      className="about-section"
      initial={{ opacity: 0, y: 50 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
    >
      <h2>About</h2>
      <p>
      My name is Calvin Nguyen, and I am a trouble shooter with a strong background in cybersecurity, full-stack development, and technology. After serving in the U.S. Army, I transitioned into the tech industry, earning certifications Googleâ€™s Cybersecurity and Data Analytics. I specialize in using tools like Splunk for SIEM and developing interactive web applications with React.js and Node.js. I am committed to continuous learning and contributing to projects that drive positive change.
      </p>
    </motion.section>
  );
}

export default About;
